import React from 'react'
import styled from 'styled-components'
import { Link } from 'react-router-dom';

const FooterContainer = styled.div`
    background-color: green;
    padding: 4rem 0 2rem 0;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;


`;
const FooterSubscription = styled.section`
    display: flex;
    /* flex-direction: column;
    justify-content: center;
    align-items: center;
    text-align: center; */
    margin-bottom: 24px;
    padding: 24px;
    color: #fff;

`;

const FooterSubText = styled.p`
margin-bottom: 24px;
font-size: 40px;
justify-content: left;



   color: red;

`;
// const Form = styled.form`
//     display: flex;
//     justify-content: center;
//     align-items: center;
//     @media screen and (max-width:820px){
//         flex-direction: column;
//         width: 80%;

//     }
// `;
// const FormInput = styled.input`
//     padding: 10px 20px;
//     border-radius: 2px;
//     margin-right: 10px;
//     outline: none;
//     border: none;
//     font-size: 16px;
//     border: 1px solid #fff;

//     &::placeholder{
//         color: #242424;

//     }
//     @media screen and (max-width:820px){
//         width: 100%;
//         margin: 0 0 16px 0;

//     }


// `;

const FooterLinksContainer = styled.div`
    width: 100%;
    max-width: 1000px;
    display: flex;
    justify-content: center;
    padding-left: 500px;

    @media screen and (max-width:820px){
        padding-top: 32px;
    }

`;
const FooterLinksWrapper = styled.div`
    display: flex;
    @media screen and (max-width:820px){
        flex-direction: column;

    }
`;
const FooterLinksItems = styled.div`
    display: flex;
    flex-direction: column;
    align-items: flex-start;
    margin: 16px;
    text-align: left;
    width: 160px;
    box-sizing: border-box;
    color: #fff;

    @media screen and (max-width:420px){
        margin: 0;
        padding: 10px;
        width: 100%;
    }

`;
const FooterLinkTitle = styled.h2`
    margin-bottom: 16px;
`;
const FooterLink = styled(Link)`
    color: #fff;
    text-decoration: none;
    margin-bottom: 0.5rem;

    &:hover{
        color: #0467fb;
        transition: 0.3 ease-out;

    }

`;
const Footer = () => {
    return (
        <FooterContainer>
            {/* <FooterSubscription>

                <FooterSubText>
                    Let's Find Your
                    <br></br>
                    Dream Home
                </FooterSubText>
            </FooterSubscription> */}

            <FooterLinksContainer>
                <FooterLinksWrapper>
                <FooterLinksItems>
                <FooterSubText>
                    Let's Find Your
                    Dream Home
                </FooterSubText>
                    </FooterLinksItems>
                    <FooterLinksItems>
                        <FooterLinkTitle>About</FooterLinkTitle>
                        <FooterLink to="/sign-up">Newsroom</FooterLink>
                        <FooterLink to="/">Careers</FooterLink>
                        <FooterLink to="/">Investors</FooterLink>
                        <FooterLink to="/">Learn about new features</FooterLink>
                    </FooterLinksItems>
                    <FooterLinksItems>
                        <FooterLinkTitle>Contact Us</FooterLinkTitle>
                        <FooterLink to="/sign-up">How it works</FooterLink>
                        <FooterLink to="/">FAQ</FooterLink>
                        <FooterLink to="/">Support</FooterLink>
                        <FooterLink to="/">Questions</FooterLink>
                    </FooterLinksItems>


                </FooterLinksWrapper>
            </FooterLinksContainer>

        </FooterContainer>
    )
}

export default Footer
